    "position_info": "{\"blocks\":[{\"key\":\"84dpj\",\"text\":\"For 25 years, the Maplefest has been welcoming people down to the 40-acre working sugar bush on tractor-pulled hay wagons!\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"fcdo\",\"text\":\"​\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"67sb0\",\"text\":\"We are currently looking for enthusiastic, energetic, and friendly volunteers to help us with two groups of work:\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"4fgp6\",\"text\":\"​\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"900td\",\"text\":\"1. Pancake House (Kitchen Helper)\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":33,\"style\":\"BOLD\"},{\"offset\":3,\"length\":30,\"style\":\"UNDERLINE\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"dnveq\",\"text\":\"​\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"6kjg4\",\"text\":\"The delicious Pancake Breakfast is served all day long by Optimist members and friends in the sugar bush. This includes pancakes, sausages, beans, maple syrup and coffee, tea, or juice.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"b80mc\",\"text\":\"​\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"e3d5i\",\"text\":\"Some of the duties include helping cook, setting tables, handing out food, and clean up.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"19n3o\",\"text\":\"​\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"4dmal\",\"text\":\"2. Activities Supervisor\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":24,\"style\":\"BOLD\"},{\"offset\":3,\"length\":21,\"style\":\"UNDERLINE\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"30keq\",\"text\":\"​\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"563ue\",\"text\":\"Supervising and helping with one or more of the following activities: woodcarving, blacksmith demos, bird feeder building, log sawing and branding, Boys Scouts rope bridge, ice-cream and butter making, candle making, taffy on snow, walk the plank, sheep shearing, adventure activities, and maple syrup creation.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"dkgdl\",\"text\":\"​\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"6t7k9\",\"text\":\"Shifts (for all positions)\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":26,\"style\":\"UNDERLINE\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"cfeht\",\"text\":\"Saturday, April 11th 9:00 AM - 12:00 PM\",\"type\":\"unordered-list-item\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"3e2s9\",\"text\":\"Saturday, April 11th 12:00 PM - 4:00 PM\",\"type\":\"unordered-list-item\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"ffksg\",\"text\":\"Sunday, April 12th 10:00 AM - 12:30 PM\",\"type\":\"unordered-list-item\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"br90c\",\"text\":\"Sunday, April 13th 12:30 PM - 3:00 PM\",\"type\":\"unordered-list-item\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}",
    "requirements": "{\"blocks\":[{\"key\":\"7ujaa\",\"text\":\"No previous experience is necessary!\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"se0\",\"text\":\"However, keep in mind that this is an outdoors event and some activities will require heavy lifting. We will work with you in determining what is your best fit.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"af1go\",\"text\":\"​\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"f17pa\",\"text\":\"Other important items:\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"85p73\",\"text\":\"Arrive 30 minutes before your shift.\",\"type\":\"unordered-list-item\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"96ev3\",\"text\":\"Dress accordingly (boots, extra layers of clothing, hats, etc.)\",\"type\":\"unordered-list-item\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"dqcc7\",\"text\":\"Minimum age is 13.\",\"type\":\"unordered-list-item\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}",
    "organization_info": "{\"blocks\":[{\"key\":\"3s89\",\"text\":\"The Egremont Optimist Club is a service club whose focus is on helping provide opportunities for our youth to reach their full potential.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"2jtfa\",\"text\":\"Our community activities help to promote economic activity in former Egremont township. Some of the biggest ones include Canada Day Fireworks and the Holstein Maplefest. They  also serve as fund raisers events to assist additional youth activities ranging from minor hockey to Big Brothers and Sisters, soccer,  school trips,  musical exchanges,  4H, and assisting children with health problems.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[{\"offset\":150,\"length\":20,\"key\":0}],\"data\":{}}],\"entityMap\":{\"0\":{\"type\":\"LINK\",\"mutability\":\"MUTABLE\",\"data\":{\"href\":\"http://www.holsteinmaplefest.com/\",\"rel\":\"noopener\",\"target\":\"_blank\",\"url\":\"http://www.holsteinmaplefest.com/\"}}}}",
    "impact": "{\"blocks\":[{\"key\":\"84mbl\",\"text\":\"​Our Service Club supports the youth in our community. All proceeds from this event go to support our youth.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}",
